import React, {Component, Fragment} from 'react';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';

class MHello extends Component {
    constructor(props) {
        super(props);
        this.date = props.date;
        this.state = {};
    }

    render(props) {
        return (
            <Fragment>

                <Grid container >
                    <Paper square="true"/>
                </Grid>


            </Fragment>
        );
    }
}

export default MHello;
